script: |
  super -f text -I q925.spq | sort > q925.out

inputs:
  - name: q925.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( col1 + + col2 ) BETWEEN - cor0.col2 AND ( NULL ) OR NOT + col0 IN ( col1 + col2 - col1 );
  - name: tab0

outputs:
  - name: q925.out
    data: |
      24	86	33
      35	97	1
      89	91	82
